export function getRandomPetName() {
    const petNames: string[] = [
        "Buddy", "Max", "Luna", "Charlie", "Bella",
        "Lucy", "Daisy", "Molly", "Bailey", "Coco",
        "Ruby", "Oliver", "Toby", "Sadie", "Oscar",
        "Loki", "Finn", "Penny", "Shadow", "Ginger"
    ];
    const randomIndex = Math.floor(Math.random() * petNames.length);
    return petNames[randomIndex];
}

export function getRandomPetBirthday(): number {
    // Function to generate a random date between two dates
    function randomDate(start: Date, end: Date): Date {
        return new Date(start.getTime() + Math.random() * (end.getTime() - start.getTime()));
    }

    // Generating a random date between Jan 1, 2010, and Dec 31, 2022
    const randomBirthday: Date = randomDate(new Date(2010, 0, 1), new Date(2022, 11, 31));

    // Formatting the date to YYMMDD
    const yy = randomBirthday.getFullYear().toString().substr(-2);
    const mm = ('0' + (randomBirthday.getMonth() + 1)).slice(-2);
    const dd = ('0' + randomBirthday.getDate()).slice(-2);
    const formattedDate = `${yy}${mm}${dd}`;

    // Converting formatted string to number
    return Number(formattedDate);
}

